import React from 'react';
import { sample_db_5km } from '../data/sample_db_5km';

const ModeChoice = ({ selectedOptionQ2 }) => {
  // Check if Q2 response is "< 5 km"
  const mode3 = selectedOptionQ2 === '< 5 km' ? 'Walk / Bicycle' : 'Metro';

  return (
    <div>
      <h1>Mode Choice</h1>

      <table>
        <tr>
          <th>Bus Type 1</th>
          <th>Bus Type 2</th>
          <th>{mode3}</th>
        </tr>
        <tr>
          <td>Alfreds Futterkiste</td>
          <td>Maria Anders</td>
          <td></td> {/* Render the mode3 value */}
        </tr>
      </table>
    </div>
  );
};

export default ModeChoice;
